import React, { useEffect } from 'react';
import './Photography.css';

const Photography = () => {
  useEffect(() => {
    // Create a script element for the Redbubble external portfolio
    const script = document.createElement('script');
    script.src = 'https://www.redbubble.com/assets/external_portfolio.js';
    script.async = true;
    document.body.appendChild(script);

    // Create another script element for initializing the Redbubble portfolio
    const initScript = document.createElement('script');
    initScript.id = 'rb-xzfcxvzx';
    initScript.type = 'text/javascript';
    initScript.innerHTML = `new RBExternalPortfolio('www.redbubble.com', 'krood16', 2, 2).renderIframe();`;
    
    // Append the init script after the external script is loaded
    script.onload = () => {
      document.getElementById('rb-embed-container').appendChild(initScript);
    };

    // Cleanup the scripts when the component unmounts
    return () => {
      document.body.removeChild(script);
      document.getElementById('rb-embed-container').removeChild(initScript);
    };
  }, []);

  return (
    <div className="photography">
      <h1>Photography</h1>
      
      {/* Embed Redbubble Portfolio */}
      <script type="text/javascript" src="https://www.redbubble.com/assets/external_portfolio.js"></script>
      <script id="rb-xzfcxvzx" type="text/javascript">new RBExternalPortfolio('www.redbubble.com', 'krood16', 3, 3).renderIframe();</script>
      <div id="rb-embed-container" className="embed-container"></div>
    </div>
  );
};

export default Photography;
